type Scene struct { Background RGBA8 Ecs_World *ecs.World start_systems List[func(*Scene)] update_systems List[func(*Scene, float32)] render_systems List[func(*Scene, float32)] tags Map[string, List[EntId]]
} A scene is the container of your level's objects and logic. It is on align with Unity's understanding of a scene, Which states that scenes and objects (prefabs) are separate unlike Godot's. You can create a scene inside an App's OnStart method. OnStart: func(){ _test_scene := chai.NewScene()
} As we mentioned Chai is an ECS based Game Engine, Which means that Objects only contain data, while the logic is cluttered somewhere else It goes like this Components are data holders (name, position, uv, speed, etc...) Entities are Identifiers that point towards the specific component Systems use the Entities to Get All the Components you would want to do logic on.

